var generate_y_data = function(length, offset){

    var y= [];
    for(var i=0; i< length; i++){

        if(offset == 10)
            y.push(0.5 - Math.random()/offset);

        else if(offset == 20)
            y.push(0.2 - Math.random()/offset);

        else
            y.push(0.8 - Math.random()/offset);
    }
    return {y:y, max: d3.max(y), min: d3.min(y)};

}

var generate_x_data = function(length){

    var x= [];
    for(var i=0; i< length; i++){

        x.push(i+1);
    }
    return x;

}

